import React , {Component} from "react"
import {NavLink} from "react-router-dom"
import jwtDecode from "jwt-decode"

class NavBar extends Component{
    state={
        user: ""
      }
    
      componentDidMount(){
       try{
          const jwt = localStorage.getItem("token")
          console.log(jwt)
           const user = jwtDecode(jwt)
          this.setState({user})
          console.log(this.state)
    
        }catch(ex){}
      }
    render(){
        //const {user} = this.props
        console.log(this.state.user)
        return(
            <div className="d-flex flex-column flex-md-row align-items-center p-3 px-md-4 mb-3 bg-white border-bottom shadow-sm">
                <h5 className="my-0 mr-md-auto font-weight-normal"><NavLink to="/" style={{textDecoration: "none", color: "black"}}>Online Product World</NavLink></h5>
                <nav className="my-2 my-md-0 mr-md-3">
                    <NavLink className="p-2 text-dark" to="/">Home</NavLink>
                    <NavLink className="p-2 text-dark" to="/Product/new">New Product</NavLink>
                    <NavLink className="p-2 text-dark" to="/LogOut">LogOut</NavLink>
                    <NavLink className="p-2 text-dark" to="/me">mm</NavLink>
                    {(this.state.user) ? null:<NavLink className="p-2 text-dark" to="/Login">Login</NavLink>}
                    {(this.state.user) ? null:<NavLink className="p-2 text-dark" to="/Register">Registeration</NavLink>}
                    
                </nav>
          </div>

        )
    }
}

export default NavBar;
